const List = (props) => {
  const { nameList } = props;
  return (
    <div>
      <style jsx>{`
        nav {
          height: 300px;
          width: 200px;
          overflow: scroll;
          border: 1px solid #ccc;

          font-size: 14px;
          font-family: Arial, sans-serif;

          -webkit-overflow-scrolling: touch;
