        ul {
          overflow: hidden;
          overflow-y: scroll;
          list-style-type: none;
          padding-inline-start: 0;
          margin-block-start: 0;
          margin-block-end: 0;
        }

        .list-content {
          padding: 0.8rem 1.2rem;
          border-bottom: 1px solid #ccc;
        }
        .list-content:nth-child(even) {
          background: #f8f8f8;
        }
        .list-content:last-child {
          border-bottom: none;
        }
      `}</style>

      <nav>
        <ul>
          {nameList.map((person, i) => {
            return (
              <div>
                <li className={"list-content"} key={person.nameId}>
                  {person.name}
                </li>
              </div>
            );
          })}
        </ul>
      </nav>
    </div>
  );
};

export default List;
